	height:150px;
	background-color:#FBB03B;

	background-color:#fff;
	height: 1265px;

	}
main svg {

}
footer{
	height:80px;
	background-color:#FBB03B;
	clear:both;
	}
	
	#alien-shown{
		visibility: hidden;
	}
	#planet-shown {
		visibility: hidden;	
	}
	#asteroid-shown{
		visibility: hidden;
	}
	#ufo-shown{
		visibility: hidden;
	}

	#alien:hover #alien-shown{
		visibility: visible;
	}
	#planet:hover #planet-shown{
		visibility: visible;
	}
	#asteroid:hover #asteroid-shown{
		visibility: visible;
	}
	#ufo:hover #ufo-shown{
		visibility: visible;
	}
	
</style>
